import { TextField,InputBase} from '@material-ui/core';
import React, { Component } from 'react';
import styles from './formstyles'
import { BlueButton } from './Atribut';
import {Container,Form,Row,Col} from 'react-bootstrap/'

class FormRegis extends Component {
    render() {
        return (
           <div>
               <Form style={{margin: "0vw 5vw"}}>
                   <h4 style={{textAlign:"left",marginLeft:"8vw"}}>Masukan Data Diri</h4>
                    <Row>
                        <Col sm={6}>
                        <div>
                            <label>Nama Depan</label>
                            <input type="text" style={styles.form} onChange={e=> this.firstName = e.target.value}></input>
                        </div>

                        </Col>
                        <Col sm={6}>
                        <InputBase
                            label="Nama Depan"
                            className="input"
                            fullWidth

                            inputProps={{ 'aria-label': 'Masukkan daerah' }}
                        />

                        </Col>
                    </Row>
                </Form>
            </div>
        );
    }
}

export default FormRegis;
